import React from "react";
import { useParams } from "react-router-dom";
import { useSelector } from "react-redux";
export default function Component_Detail() {

    const { key } = useParams();
    const deed = useSelector(state => {
        state.data.find((el) => el.key === key)
    })
    console.log(deed)
    return (
        <section>
            <h1>{deed.title}</h1>
        </section>
    );
}
